]; The DCN module and CLUB module are lazy loaded when we try to access to DCN or CLUB page Note, we are implementing redirection mechanism so we set useHash to true. app-routing.module.ts: @NgModule({ imports: [ RouterModule.forRoot(routes, {useHash: true}), ], exports: [RouterModule],
}) Sometimes, the server does not support HTML5 pushstate required by PathLocationStrategy of Angular. In order to make redirection mechanism work, it is easier to use HashLocationStrategy. Each time we reload the page, the server will redirect to the current path found in the URL rather than redirect us to the homepage. With this feature added, user can go directly to the dossier page by typing the dossier path in the URL. This feature is useful when user try to bookmark a dossier page, the next time they open that bookmark, LCF app will go directly to the dossier without passing through the homepage.

